I have an ambitious dream,
Which is so impossible its seem;

To travel all around Earth,
To meet the kangaroos in Perth;
To be mesmerised by the islands in Boracay,
To be in NZ and witness aurora ray;
And there is many more,
But let me not make any bore;

But I am gonna share to you something sad, 
Brunei is the only foreign country I've made;

In between my career and study,
Of finding time and money; 
I've crossed only two countries on the map, 
Dear Tripviss help me cross another gap;
Grant my wish to travel to a beautiful destination,
Forever my gratitude will be mentioned.
